The key psychological mechanisms in the Ultimatum Game, when acting as a responder, involve fairness considerations and self-interest. Participants evaluate the proposed split based on several factors. First, how it relates to their contribution ("token_self") and their opponent's contribution ("token_opp"). Second, the absolute amount they would receive ("split_self"). Third, the overall pot size ("combined_earning"). Individuals might feel slighted when the proposed split is highly unequal in proportion to their contribution to the earned money, resulting in lower utility.

These mechanisms interact as follows: A baseline utility is determined by the offered amount ("split_self"), which can be scaled by the fairness consideration. The fairness consideration includes the proportion of effort they put into earning the "combined_earning". This fairness aspect can either lower or increase the baseline utility.

The mathematical form should capture the utility as a function of the absolute amount offered ("split_self") modified by a fairness term. The fairness term will weigh the token contributions. We can use a relative contribution to capture fairness by dividing ones own tokens by the total number of tokens.
The parameters needed to calibrate the model would be:
1. A sensitivity parameter to the absolute amount offered. This reflects how much the responder values money.
2. A fairness parameter to weight the fairness term. This parameter will reflect the weight that a player puts on fairness compared to absolute earning.

The model variables map to observable behavior through the "accept" variable. A higher utility will lead to a higher probability of accepting the offer. We'll map utility to acceptance probability using a logistic function.

```
<MODEL>
U = alpha * split_self + beta * (token_self / (token_self + token_opp))
</MODEL>

<VARIABLES>
